import React, { useContext, useState } from 'react'
import Product from './Product'

const Main = ({bikes}) => {
  
  return (
    <main className='main'>
        {bikes.map(bike => <Product key={bike.id} name={bike.name}  description={bike.description} img={bike.img} price={bike.price} />)}
        
    </main>

  )
}

export default Main
